import React from "react";
import { ReactComponent  as CheckSVG} from './check.svg'
import { ReactComponent as DeleteSVG} from './delete.svg'

export function TodoIcon({type}){
    return(
        <span className={`Icon-svg Icon-${type}`}>
            <CheckSVG/>
            <DeleteSVG/>
        </span> 
    )
}
